description:
Raising the Kursk

Technology Documentary hosted by Richard Hageman, published by Discovery Channel in 2002 - English narration


Information
------------------------------

K-141 Kursk was an Oscar-II class nuclear-powered cruise missile submarine of the Russian Navy, lost with all 118 hands when it sank in the Barents Sea on August 12, 2000. 
At 154m long and four stories high it was the largest attack submarine ever built. To serve aboard the Oscar-II class nuclear submarine was always considered safe, so accidental explosion rocked not only the Russian government, military experts and families of the victims, but causing also extensive discussion in the international community. The Russian government decided to conduct the largest-ever marine salvage operation. By interviews with personnel and graphical analysis of the scene, you will witness how the tireless divers worked day and night in a race against the clock. 'Raising the Kursk' tells the true story of this extremely complex operation.

Produced by CineNova Productions Inc. for Discovery Channel

